INSERT INTO `W_Teacher` VALUES ('114', '陈老师', '15+', '高中', '数学', '高级教师', '硕士，北京市重点中学高级教师，区骨干教师，区数学教研员、教研组长。多次获得北京市教学比赛一等奖、二等奖，“华罗庚金杯数学竞赛”优秀教练，北京市“迎春杯数学竞赛”金牌教练，多年高三教学经历，两届从初一到高三数学直升实验班，所带高三数学高考平均分在127---134分，所带学生参加全国高中数学联赛分获二，三等奖。参加北京市“数学建构”重点课题，承担清华大学MBA考前辅导数学学科培训工作，参与国家MBA官方培训教材《MBA数学同步辅导》丛书编写，有多部教学专著出版。');
INSERT INTO `W_Teacher` VALUES ('115', '赵丽娜', '12+', '高中', '英语', '高级教师', '国家级：2003年获全国“优秀辅导教师奖”2008年论文《英语课堂教学中的创新教育》获全国一等奖。2010年论文《浅论英语阅读教学》获全国一等奖。2011年在国培计划中获“英语教案设计”一等奖。市级：2006年获市级评优课“一等奖”2008年辅导学生获市级一等奖，被评为“优秀辅导教师”。2010年在第五届全国中小学英语教师教学技能大赛中获市级“二等奖”。');
