INSERT INTO `W_Teacher` VALUES ('118', '苏老师', '12+', '高中', '英语', '高级教师', '省教学能手多篇教育教学论文在省级刊物发表');
INSERT INTO `W_Teacher` VALUES ('119', '盖老师', '12+', '高中', '英语', '高级教师', '2004年被聘为巨鹿县新课程改革实验中学学科带头人。同年荣获巨鹿县“五个百”工程教案评比一等奖。2006年得到县委县政府嘉奖。2008年被评为县级模范教师。2009年再次得到县委县政府嘉奖。2010年再次得到县委县政府嘉奖。2011年在河北师大参加河北省高中英语骨干教师培训并获得优秀学员称号。2012年获得巨鹿县优质课一等奖。同年获得邢台市第一届中小学阅读课优秀教学案例教学成果一等奖。再次得到县委县政府嘉奖。再次被评为县级模范教师。参与的邢台市教育科学\"十一五”规划立项课题课题《新课标下英语课堂有效教学研究》结题。2013年获得邢台市优质课二等奖2014年获得河北省第一届微课大赛一等奖。再次参加河北省高中英语骨干教师培训并获优秀学员称号。');
