INSERT INTO `W_Teacher` VALUES ('122', '乔老师', '12+', '高中', '英语', '高级教师', '1986年在石家庄地区1986年高中青年教师英语优秀课评选中，荣获一等奖1996年，荣获全国中小学外语教师园丁奖2001年在首届全国中学英语教师教学技能大赛中，荣获新华区高中教师组一等奖1999年，所著论文《调动积极性，上好英语课》发表在国家级刊物《教育实践与研究》第2期1999年，所著论文《WordStudy教学初探》发表在国家级刊物《中小学教育与管理》论文集2001年，所著论文《英语教学中如何进行创新教育》发表在国家级刊物《教育实践与研究》第6期2008年，所著论文《英语教学培养跨文化意识的原则和策略》发表在国家级刊物《教学实践与研究》第10期A2009年，所著论文《任务型阅读课型教学设计与说明》发表在国家级刊物《教学实践与研究》第10期B2005年5月第一版高中英语必修五（人教版）《剖析》（学苑出版社）2006年9月第一版的八年级上英语（人教版）《思维发散创新训练》（河北人民出版社）2006年12月第一版的七年级下英语（冀教版）《思维发散创新训练》（河北人民出版社）2007年8月第二版的八年级上英语（人教版）《思维发散创新训练》（河北人民出版社）');
