INSERT INTO `W_Teacher` VALUES ('127', '李老师', '12+', '高中', '英语', '高级教师', '一直以来十分注重专业知识的积累，努力提高专业水平，课堂教学中语言生动、丰富，感染力强，，深受学生喜爱，在学校每次举行的学生对老师的评议中多次排名第一。2011高中历史教师学科能力培训中“命题说题”能力展示，2012年安吉高中文化课教师解题能力竞赛获县二等奖，县高考论坛专题讲座《导学案在高考一轮复习中的使用》，参与市高二历史教研活动课堂点评；担任市级课题《以问题为中心的命题类型与历史教学策略的研究》执笔，并获市二等奖；参与课题《高三历史复习三轮导学案的探究与应用》获市一等奖。');
INSERT INTO `W_Teacher` VALUES ('128', '赵老师', '12+', '高中', '英语', '高级教师', '国家级：2003年获全国“优秀辅导教师奖”2008年论文《英语课堂教学中的创新教育》获全国一等奖。2010年论文《浅论英语阅读教学》获全国一等奖。2011年在国培计划中获“英语教案设计”一等奖。市级：2006年获市级评优课“一等奖”2008年辅导学生获市级一等奖，被评为“优秀辅导教师”。2010年在第五届全国中小学英语教师教学技能大赛中获市级“二等奖”。');
INSERT INTO `W_Teacher` VALUES ('129', '苏老师', '12+', '高中', '英语', '高级教师', '毕业于河北师范大学历史系,一直从事高中历史教学工作，勤奋刻苦，注重以德育人，以研促教，为做一名学者型教师孜孜努力.《让棵棵小树都参天》《元朝短命之我见》《浅谈历史教学中的社会主义核心价值观的教育》等多篇论文在省级刊物上发表或获奖。');
