INSERT INTO `W_Teacher` VALUES ('167', '李老师', '12+', '高中', '物理', '高级教师', '一直以来十分注重专业知识的积累，努力提高专业水平，课堂教学中语言生动、丰富，感染力强，，深受学生喜爱，在学校每次举行的学生对老师的评议中多次排名第一。2011高中历史教师学科能力培训中“命题说题”能力展示，2012年安吉高中文化课教师解题能力竞赛获县二等奖，县高考论坛专题讲座《导学案在高考一轮复习中的使用》，参与市高二历史教研活动课堂点评；担任市级课题《以问题为中心的命题类型与历史教学策略的研究》执笔，并获市二等奖；参与课题《高三历史复习三轮导学案的探究与应用》获市一等奖。');
