INSERT INTO `W_Teacher` VALUES ('191', '刘麦旺', '12+', '初中', '物理', '高级教师', '1999年论文《兴趣小制作和物理教学》在渭南市中学物理教学研究会上交流，并获得一等奖。2006年论文《应用“三个四”推进差生教育转化》在教师报举办的第八届全国教育教学论文大赛中荣获一等奖，并发表在全国教师优秀教育教学论文集上。2007年论文《开展兴趣活动，促进物理教学》在《教学理论与实践》编辑部举办的优秀论文竟活动中获得一等奖，并发表在《教学理论与实践》杂志上。');
