INSERT INTO `W_Teacher` VALUES ('217', '孙老师', '12+', '高中', '化学', '高级教师', '2012年3月,参与编写的《乐安公园与广饶历史》获山东省教育科研成果一等奖。2012年3月，执教广饶县公开课《古代中国的政治与世界》2012年5月，执教的《新航路的开辟》获得县优质课一等奖。2012年5月，执教的《新航路的开辟》获得市优质课一等奖。2012年7月，执教的《新航路的开辟》获得省电化教学优质课评选三等奖。2013年4月，执教的《走向整体世界》获得省课程资源开发与利用优质课三等奖。2014年8月，撰写的《新航路的开辟》教学设计获得县一等奖。');
