INSERT INTO `W_Teacher` VALUES ('220', '向老师', '12+', '高中', '化学', '高级教师', '参加校本教材《生活中的化学》编写工作；独立撰写多篇论文：其中《差量法在化学中的运用》，《氧化还原反应易错知识点》参加重庆市第五届基础改革论文大赛获三等奖;文章《将爱默默送给需要的学生》，发表在德育核心杂志《班主任》2009第11期上。《化学中的美育》获市基础征文二等奖');
INSERT INTO `W_Teacher` VALUES ('221', '陈老师', '12+', '高中', '化学', '高级教师', '2003、2004年主持的两个市级课题优秀结题，2007年参与过国家“十五”重点课题并结题2009年主持的全国教育科学“十一五”规划教育部重点课题的子课题结题2010年参加教育部基础教育课程教材发展中心主办的“菁华杯”首届全国新课程中学优质课评选活动中荣获教学设计一等奖另有多篇论文在县市评比中获奖在《中学生学习报》、《学习周报》、《中学化学》等发表过测试题30多篇参与主编、编写如下图书：《2010年浙江高中总复习——高考密码》（副主编）《2010年福建高中总复习——高考密码》（编者）《名师专题（金属及其化合物）》（编者）《中学教材精典解析（化学1）》（主编）《中学教材精典解析（化学2）》（编者）《中学教材精典解析（选修5）》（编者）《疑难与规律详解（高中化学2）》（主编）《全国著名重点中学领航高考冲刺试卷（领航卷）》《北京-黄冈高考最后冲刺预测试卷（北-黄卷）》《高考<考试大纲>调研卷（猜题卷）》《考前必做100题》《疑难与规律详解（有机化学基础）》（主编）《倍速学习法（必修2）》（主编）《倍速学习法（必修1）》（主编）《教材解读与拓展（选修4）》（主编）');
