INSERT INTO `W_Teacher` VALUES ('262', '马老师', '12+', '高中', '生物', '高级教师', '河北省中学生物创新改革教学大赛一等奖；多次辅导学生参加河北省青少年科技创新大赛并获一、二等奖；保定市“教学标兵”；多次参与高考复习资料及高考模拟题的编纂。论文：“转基因食品的现状及发展展望”，中学生物学，2007、1“RNA干扰的研究进展”，科学中国，2007、6“人类的X、Y染色体是同源染色体吗”，生物学教学，2014、6“显微镜物镜的标示、使用及维护”，河北省高中生物论文评比一等奖，2014、8“绿叶中色素的提取和分离”实验改进，河北省高中生物论文评比二等奖，2014、8指导闫芳老师在河北省第二届生物课堂实验教学案例展评中荣获高中组一等奖：“观察DNA和RNA在细胞中的分布”实验教学案例');
INSERT INTO `W_Teacher` VALUES ('263', '张老师', '12+', '高中', '生物', '高级教师', '本人一直从事高中生物教学工作，工作认真踏实。多次获得教学荣誉，例如：2010年的市级优秀教师、2011年市级教学能手，2011年“押题能手”称号，2012年优秀班主任等。在2011年被学校选派参加高考阅卷工作。2013年《新课标下的生物教学》获得省级二等奖。');
INSERT INTO `W_Teacher` VALUES ('264', '马兰萍', '12+', '高中', '生物', '高级教师', '河北省中学生物创新改革教学大赛一等奖；多次辅导学生参加河北省青少年科技创新大赛并获一、二等奖；保定市“教学标兵”；多次参与高考复习资料及高考模拟题的编纂。论文：“转基因食品的现状及发展展望”，中学生物学，2007、1“RNA干扰的研究进展”，科学中国，2007、6“人类的X、Y染色体是同源染色体吗”，生物学教学，2014、6“显微镜物镜的标示、使用及维护”，河北省高中生物论文评比一等奖，2014、8“绿叶中色素的提取和分离”实验改进，河北省高中生物论文评比二等奖，2014、8指导闫芳老师在河北省第二届生物课堂实验教学案例展评中荣获高中组一等奖：“观察DNA和RNA在细胞中的分布”实验教学案例');
