INSERT INTO `W_Teacher` VALUES ('266', '冯老师', '12+', '高中', '生物', '高级教师', '2012年3月,参与编写的《乐安公园与广饶历史》获山东省教育科研成果一等奖。2012年3月，执教广饶县公开课《古代中国的政治与世界》2012年5月，执教的《新航路的开辟》获得县优质课一等奖。2012年5月，执教的《新航路的开辟》获得市优质课一等奖。2012年7月，执教的《新航路的开辟》获得省电化教学优质课评选三等奖。2013年4月，执教的《走向整体世界》获得省课程资源开发与利用优质课三等奖。2014年8月，撰写的《新航路的开辟》教学设计获得县一等奖。');
INSERT INTO `W_Teacher` VALUES ('267', '隋老师', '12+', '高中', '生物', '高级教师', '2011年平度市教科研带头人');
INSERT INTO `W_Teacher` VALUES ('268', '隋老师', '12+', '高中', '生物', '高级教师', '毕业于河北师范大学历史系,一直从事高中历史教学工作，勤奋刻苦，注重以德育人，以研促教，为做一名学者型教师孜孜努力.《让棵棵小树都参天》《元朝短命之我见》《浅谈历史教学中的社会主义核心价值观的教育》等多篇论文在省级刊物上发表或获奖。');
INSERT INTO `W_Teacher` VALUES ('269', '杜老师', '12+', '高中', '生物', '高级教师', '辅导学生参加河北省青少年科技创新大赛并获二等奖“揭秘胎盘”发表于中学生物学参与高考模拟试题分析会获一等奖“群落的演替”获河北省学科说课评比一等奖12年被评为保定市“学科教学标兵”多次指导学生参加生物奥赛并获得优异成绩高考考试中荣获生物学科优胜奖多篇教学设计获市级和省级奖励论文“探究式教学在生物教学中的应用”获省级一等奖论文“高中生物少教多学模式初探”获省级二等奖');
INSERT INTO `W_Teacher` VALUES ('270', '陈老师', '12+', '高中', '生物', '高级教师', '毕业于河北师范大学历史系,一直从事高中历史教学工作，勤奋刻苦，注重以德育人，以研促教，为做一名学者型教师孜孜努力.《让棵棵小树都参天》《元朝短命之我见》《浅谈历史教学中的社会主义核心价值观的教育》等多篇论文在省级刊物上发表或获奖。');
INSERT INTO `W_Teacher` VALUES ('271', '李海燕', '12+', '高中', '生物', '高级教师', '《教学考试》杂志2012-2013年度优秀作者同心圆梦2014届优秀编委2014世纪金榜《考前》编委、2015世纪金榜二轮（课标版、广东版、江苏版）2015南京恩波教育《高考理科综合小题狂做•强化篇》省市论文少量');
