INSERT INTO `W_Teacher` VALUES ('275', '汤老师', '12+', '初中', '生物', '高级教师', '汤爱兰老师,1997年毕业于井冈山大学物理系，教龄18年。一直从教初二初三物理教学,教学经验丰富，所任教班级中考成绩优秀。在学校的中考成绩中经常列平行班第一名.汤老师擅长钻研物理教学，参加各类比赛多次获得奖励。教学论文《生物学中的物理知识》在《中学物理》发表，2006年辅导学生参加全国物理应用知识大赛获省二等奖，2007年参加百课竞赛分获片、县市一等奖，市二等奖，2009主持课题《网络测试系统在物理练习复习课中的运用》在省里立项并结题，2008年以来，每年参加课件制作大赛获市一等奖');
