INSERT INTO `W_Teacher` VALUES ('314', '杜老师', '15+', '高中', '地理', '高级教师', '北京市重点中学高级教师，教研组组长，北京市地理学科骨干教师，首师大教育硕士特聘导师、区教师资格测试专家。高三教学成绩突出，任教的历届高考成绩均超过北京市十所重点校。教学设计、论文、成果获国家级、市区级奖达几十项。参与编写书3本，公开发表文章多篇。多次参与课题研究并任子课题负责人。');
