INSERT INTO `W_Teacher` VALUES ('320', '杨老师', '12+', '高中', '历史', '高级教师', '2010年获县讲课比赛二等奖2010年获县级教学质量奖2012获县讲课比赛二等奖2013年获县级教学成绩奖2013年发表国家级论文两篇');
INSERT INTO `W_Teacher` VALUES ('321', '王老师', '12+', '高中', '历史', '高级教师', '毕业于河北师范大学历史系,一直从事高中历史教学工作，勤奋刻苦，注重以德育人，以研促教，为做一名学者型教师孜孜努力.《让棵棵小树都参天》《元朝短命之我见》《浅谈历史教学中的社会主义核心价值观的教育》等多篇论文在省级刊物上发表或获奖。');
INSERT INTO `W_Teacher` VALUES ('322', '刘老师', '12+', '高中', '历史', '高级教师', '2012年3月,参与编写的《乐安公园与广饶历史》获山东省教育科研成果一等奖。2012年3月，执教广饶县公开课《古代中国的政治与世界》2012年5月，执教的《新航路的开辟》获得县优质课一等奖。2012年5月，执教的《新航路的开辟》获得市优质课一等奖。2012年7月，执教的《新航路的开辟》获得省电化教学优质课评选三等奖。2013年4月，执教的《走向整体世界》获得省课程资源开发与利用优质课三等奖。2014年8月，撰写的《新航路的开辟》教学设计获得县一等奖。');
