INSERT INTO `W_Teacher` VALUES ('332', '刘老师', '12+', '初中', '历史', '高级教师', '2008年：中学历史教研专版发表浅谈初中历史教学几点感悟2010年1月：被聘沧州师专国培教师（聘证书）新课程初中历史教学案第7期发表《美国南北战争》多媒体教学案设计与评析2010年12月《全品学联考》九年级上下册主编2011年：“沧州市名师成长论坛”示范课（世纪荣誉）2011年：新课程初中历史教学案第11期教法探航栏目发表《用心灵感知充满智慧的历史课堂》2012年12月河北省沧州市中考演讨复习示范课（世纪荣誉）2012年12月《2013全品新中考历史短平快》主编《2013河北专版全品中考历史复习方案》主编《2013全品中考历史多夺分天天练》主编《2013河北中考试题研究》、《2013和给热点解读》《2013年河北中考速查》编委2012年获河北省录相课一等奖,主编《全品河北中考复习方案》《考出好成绩》《安徽中考总动员》等一系列从书。人民教育出版网、河北省素质报、山西新课程、学习方法报、方法报及海南考试报优秀作者，有大量原创试题发表');
