INSERT INTO `W_Teacher` VALUES ('348', '隽老师', '15+', '高中', '历史', '高级教师', '北京市重点中学高级教师，优秀党员，区骨干教师，教龄近20年，经历多轮完整的高一到高三的教学工作。多次受邀做市、区级历史公开课。曾连续多年担任北京市重点中学高三文科实验班历史教学工作，具有多年的高三教学经历，所教学生多次成为区历史高考单科状元。先后多次参与区历史高考一模命题工作和北京市高考试卷批卷工作，对高考学生答卷实际情况有较多了解。多次获北京市、区教学设计大赛中获一等奖、二等奖。多篇论文获全国论文评比一等奖，北京市论文评比一等奖，并发表于国家级核心刊物，并参与中学历史教学专著《高中历史教研活动课程化探索与实践》一书编写，计6万多字。');
INSERT INTO `W_Teacher` VALUES ('349', '黄丹', '12+', '高中', '政治', '高级教师', '近年来，本人在《中学政治参考》、《中学生时事政治报》、《考试报》、《当代中学生报》、《时政周刊》、《新高考》等报刊杂志发表辅导类、试题类文章300多篇；曾担任了《金考卷》、《高考复习讲义》、《夏建新文化大课堂》、《南方新课堂》、《高考风向标》等辅导资料的副编辑或编辑；同时还担任了山东金榜苑、步步高、中学学科网、第二教育网、91淘客网、学大微课课程的录制。');
INSERT INTO `W_Teacher` VALUES ('350', '韩老师', '12+', '高中', '政治', '高级教师', '1、山东省滨州市思想政治课优质课评比第一名2、山东省思想政治课优质课获奖3、在山东省普通中小足额创新发展研讨会上指教公开课《个人收入的分配》4、山东省滨州市思想政治课教学能手5、山东省滨州市第一批优秀园丁6、山东省滨州市优秀教师7、2011、2012、2013、2014年连续四年获得山东省全省远程研修优秀学员称号。8、教学设计《日新月异的科技生活》编入山东省教研室《课堂教学设计教案》。获得省级论文一等奖。9、获得省级、市级论文多篇。10、长期工作在教学一线，教学经验丰富，教学成绩突出，深受广大师生喜爱。多次被评为教学先进个人及学生最喜欢的老师。');
