INSERT INTO `W_Teacher` VALUES ('356', '陈巧燕', '12+', '高中', '政治', '高级教师', '1、2003、4《要重视思维发散的培养》获“课堂教学改革优秀论文”二等奖（山西省教育学会）2、2004、4《“矛盾的普遍性与特殊性”的教法改革》获获“第二届课堂教学优秀论文”一等奖（山西省教育学会）3、2004、9论文《宽容是一种美德》获运城市教育局第二十个教师节“做人民满意的教师”主题征文三等奖；4、2008年新课改论文《行进中的歌》荣获“中国教育实践与研究论坛”论文大赛二等奖；5、2009、6、18《快乐大款》在山西“三晋都市报”教育专栏刊登。6、2010、6《让孩子的心里充满阳光》获“烛光---教育教学文萃”优秀论文一等奖（北京科文博览教育科学研究所）7、2010、11《体育课中的挫折教育》获第六届全国中小学教师论文大赛二等奖（中国中小学教育学会）8、2012年04月08日获山西省教育厅“创新优秀试卷”评比一等奖9、2014、6“高考复习专题”发布于《中学生时事政治报》10、运城市优秀教师11、运城市学科带头人');
