INSERT INTO `W_Teacher` VALUES ('358', '冯老师', '12+', '高中', '政治', '高级教师', '从教至今，先后有800多篇论文在省市和国家级刊物上发表或获奖；有1本专著、5本合著发表；有9个独立完成并获奖课题，其教科研成果在义乌市乃至在全国均享有较高声誉，曾被全国教师教育学会综合实践活动学科委员会评为2010年度课题研究先进个人。');
