INSERT INTO `W_Teacher` VALUES ('361', '张老师', '12+', '高中', '政治', '高级教师', '安徽省级教坛新星，滁州市级学科带头人，市级优秀党员。1.2004年参与的国家级课题研究成果之一“高中学生心理状况分析与对策”获国家优秀课题成果二等奖（与他人合作）2.2006年参与国家级课题“高中思想政治课改革的深化研究”研究并成功结题3.2008年参与滁州市级课题“新课程背景下高中学生思想状况问题的研究”研究并已结题4.2010年主持滁州市级课题“研究性学习方法整合思想政治课教学的研究”研究并结题5.2009年论文“对高中思想政治课与人性教育的反思”获市一等奖6.2009年教学课件获全国思想品德、思想政治优质课件二等奖7.2010年论文“从责任培养看思想政治课的德育价值”获市一等奖8.2010年“高考模拟试题”在中学思想品德、思想政治教师命题能力活动中获市一等奖9.2011年指导学生张顺忻在滁州市第一届“时事杯”中学生“党在我心中”小论文评选中获市一等奖10.2011年论文“高中思想政治课中人性教育之思考”刊登在国家级学术期刊“课外阅读”8月刊11.2011年论文“从责任培养看思想政治课的德育价值”刊登在国家级学术期刊“课外阅读”9月刊');
INSERT INTO `W_Teacher` VALUES ('362', '张光文', '12+', '高中', '政治', '高级教师', '安徽省级教坛新星，滁州市级学科带头人，市级优秀党员。1.2004年参与的国家级课题研究成果之一“高中学生心理状况分析与对策”获国家优秀课题成果二等奖（与他人合作）2.2006年参与国家级课题“高中思想政治课改革的深化研究”研究并成功结题3.2008年参与滁州市级课题“新课程背景下高中学生思想状况问题的研究”研究并已结题4.2010年主持滁州市级课题“研究性学习方法整合思想政治课教学的研究”研究并结题5.2009年论文“对高中思想政治课与人性教育的反思”获市一等奖6.2009年教学课件获全国思想品德、思想政治优质课件二等奖7.2010年论文“从责任培养看思想政治课的德育价值”获市一等奖8.2010年“高考模拟试题”在中学思想品德、思想政治教师命题能力活动中获市一等奖9.2011年指导学生张顺忻在滁州市第一届“时事杯”中学生“党在我心中”小论文评选中获市一等奖10.2011年论文“高中思想政治课中人性教育之思考”刊登在国家级学术期刊“课外阅读”8月刊11.2011年论文“从责任培养看思想政治课的德育价值”刊登在国家级学术期刊“课外阅读”9月刊');
INSERT INTO `W_Teacher` VALUES ('363', '张老师', '12+', '初中', '政治', '高级教师', '先后获得泰安市优质课二等奖、肥城市优质课一等奖等荣誉，被评为肥城市优秀教师、肥城市优秀共青团员、肥城市优秀教研组长、肥城市教学质量先进个人、肥城市教学能手、肥城市教育教学优秀班主任等称号。');
