INSERT INTO `W_Teacher` VALUES ('370', '明月老师', '15+', '高中', '政治', '高级教师', '1、山东省滨州市思想政治课优质课评比第一名2、山东省思想政治课优质课获奖3、在山东省普通中小足额创新发展研讨会上指教公开课《个人收入的分配》4、山东省滨州市思想政治课教学能手5、山东省滨州市第一批优秀园丁6、山东省滨州市优秀教师7、2011、2012、2013、2014年连续四年获得山东省全省远程研修优秀学员称号。8、教学设计《日新月异的科技生活》编入山东省教研室《课堂教学设计教案》。获得省级论文一等奖。9、获得省级、市级论文多篇。10、长期工作在教学一线，教学经验丰富，教学成绩突出，深受广大师生喜爱。多次被评为教学先进个人及学生最喜欢的老师。');
